import React from 'react';
import './OnlineResources.css';

const articles = [
  { id: 1, title: "Article 1", content: "Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed .........", color: "#f8e1e1" },
  { id: 2, title: "Article 2", content: "Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed .........", color: "#e1f8e1" },
  { id: 3, title: "Article 3", content: "Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed .........", color: "#e1e8f8" },
  { id: 4, title: "Article 4", content: "Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed .........", color: "#f8f8e1" }
];

const videos = [
  { id: 1, title: "Video 1", content: "Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed .........", color: "#f8e1e1" },
  { id: 2, title: "Video 2", content: "Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed .........", color: "#e1f8e1" },
  { id: 3, title: "Video 3", content: "Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed .........", color: "#e1e8f8" },
  { id: 4, title: "Video 4", content: "Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed .........", color: "#f8f8e1" }
];

function OnlineResources() {
  return (
    <div className="online-resources">
      <h2>Online Resources</h2>
      <div className="articles">
        {articles.map(article => (
          <div key={article.id} className="resource" style={{ backgroundColor: article.color }}>
            <div className="image-placeholder"></div>
            <h3>{article.title}</h3>
            <p>{article.content}</p>
          </div>
        ))}
      </div>
      <div className="videos">
        {videos.map(video => (
          <div key={video.id} className="resource" style={{ backgroundColor: video.color }}>
            <div className="video-placeholder">
              <div className="play-button">&#9658;</div>
            </div>
            <h3>{video.title}</h3>
            <p>{video.content}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default OnlineResources;
